import React, { useState } from 'react';

export default function Hero() {
  const [count, setCount] = useState(0);

  const Increment = () => setCount(previousCount => previousCount +1);

  return(
      <>
      <h1>{count}</h1>
      <button onClick={Increment}>Increase</button>
      </>
  )
}
